import React from "react";

export const GridItem = ({ title, text, image, alt, url }) => {
  return (
    <div>
      {title && <h1>{title}</h1>}
      {text && <p>{text}</p>}
      {image && <img src={image} alt={alt} />}
      {url && <a href={url}>Link</a>}
    </div>
  );
};

export const CardWithTitleTextImageUrl = ({ title, text, image, alt, url }) => {
  return (
    <div className="card relative flex w-80 flex-col rounded-xl dark:bg-gray-800 bg-white bg-clip-border dark:text-white text-gray-700 shadow-md border-spacing-10">
      <img src={image} alt={alt} className="size-fit rounded-xl max" />
      <div className="p-6">
        <h5 className="mb-2 block font-sans text-xl font-semibold leading-snug tracking-normal text-blue-gray-900 antialiased">{title}</h5>
        <p className="block font-sans text-base font-light leading-relaxed text-inherit antialiased">{text}</p>
      </div>
      <div className="p-6 pt-0">
        <button
          data-ripple-light="true"
          type="button"
          className="select-none rounded-lg bg-blue-500 py-3 px-6 text-center align-middle font-sans text-xs font-bold uppercase text-white shadow-md shadow-blue-500/20 transition-all hover:shadow-lg hover:shadow-blue-500/40 focus:opacity-[0.85] focus:shadow-none active:opacity-[0.85] active:shadow-none disabled:pointer-events-none disabled:opacity-50 disabled:shadow-none"
        >
          <a href={url}>Read More</a>
        </button>
      </div>
    </div>
  );
};
